import styled from 'styled-components';

export const Container = styled.div`
	width: 80%;
	height: 10vh;
	margin: 10px auto;
	background-color: white;
	border-radius: 16px;
	box-shadow: 4px 4px 8px lightgray;
	display: flex;
	justify-content: space-around;
	& > * {
		margin: 20px auto;
	};
	select {
		line-height: 2;
	}

`;
